// SPDX-License-Identifier: GPL-3.0-or-later
pragma solidity ^0.8.1;

import "./CoreAccess.sol";
import "./IGridCell.sol";
import "./ICellClockAuction.sol";

contract CoreCellControls is CoreAccess {
    uint public discoveredCellMinPrice = 1e17 wei; //0.1 ETH

    /// @dev The address of the GridCell contract that holds the data for all CELLs
    IGridCell public cellContract;

    /// @dev The address of the ClockAuction contract that handles sales of CELLs.
    ///  This contract handles both peer-to-peer sales as well as the 'discovered CELL' sales
    ICellClockAuction public cellClockAuctionContract;

    constructor() { }

    /// @dev Sets the reference to the CELL token contract
    /// @param _address - Address of the contract
    function setCellContractAddress(address _address) external onlyRole(ROLE_OWNER) {
        IGridCell _candidateContract = IGridCell(_address);

        require(
            _candidateContract.supportsInterface(type(IGridCell).interfaceId),
            "Contract is not of type GridCell"
        );

        // Set the new contract address
        cellContract = _candidateContract;
    }

    /// @dev Sets the reference to the Cell clock auction contract
    /// @param _address - Address of the contract
    function setCellClockAuctionContractAddress(address _address) external onlyRole(ROLE_OWNER) {
        ICellClockAuction _candidateContract = ICellClockAuction(_address);

        require(
            _candidateContract.supportsInterface(type(ICellClockAuction).interfaceId),
            "Contract is not of type CellClockAuction"
        );

        // Set the new contract address
        cellClockAuctionContract = _candidateContract;
    }

    /// @dev 'Discover' (create) a new CELL token (tile) on The Grid, spiraling outwards from [0,0]
    /// Discovered CELL tokens are immediately put up for auction
    /// The auction price decreases over 7 days, unless it was in the first 225 tiles, which have fixed prices
    function discoverCell() public onlyRole(ROLE_OPERATOR) {
        require(address(cellContract) != address(0), "cellContract has not been set");
        require(address(cellClockAuctionContract) != address(0), "cellClockAuctionContract has not been set");

        //get the current total number of CELLs
        uint _gridSize = cellContract.totalSupply();

        //assign teams in a random fashion
        uint8 _initialTeam = uint8(uint256(keccak256(abi.encodePacked(block.timestamp, _gridSize))) % 8);

        //create the new CELL
        uint _cellId = cellContract.createCell(uint256(0), _initialTeam, address(this));

        //use the new total CELL count
        _gridSize++;

        //now figure out what the auction prices are for this CELL
        uint _startingPrice;
        uint _endingPrice;

        if (_gridSize > 225) {
            _startingPrice = _getNextDiscoveredCellPrice();
            _endingPrice = discoveredCellMinPrice;
        } else {
            //centre of the world
            if (_gridSize == 1) {
                _startingPrice = 25e16 wei; //TEST VALUE
                //_startingPrice = 15 ether;
            //Cell within the second central cartographical square
            } else if (_gridSize <= 9) {
                _startingPrice = 5 ether;
            //Cell within the third central cartographical square
            } else if (_gridSize <= 25) {
                _startingPrice = 3 ether;
            //Cell within the fourth central cartographical square
            } else if (_gridSize <= 49) {
                _startingPrice = 15e17 wei; //1.5 ETH
            //Cell within the fifth central cartographical square
            } else if (_gridSize <= 81) {
                _startingPrice = 75e16 wei; //0.75 ETH
            //Cell within the sixth central cartographical square
            } else {
                _startingPrice = 5e17 wei; //0.5 ETH
            }

            //price is fixed for these special tiles
            _endingPrice = _startingPrice;
        }

        //transfer ownership of the CELL to the auction contract
        cellContract.approve(address(cellClockAuctionContract), _cellId);

        require(_startingPrice > 0 && _endingPrice > 0, "Invalid auction prices");

        //start the auction
        cellClockAuctionContract.createAuction(_cellId, _startingPrice, _endingPrice, 7 days, payable(address(this)));
    }

    /// @dev Create a new CELL token in the Grid, with specific properties
    /// This special cell may be immediately transferred to a specific owner
    /// This function should only be called very rarely (giveaway competitions etc.)
    /// @param _properties - A predefined properties string for the CELL
    /// @param _initialTeam - ID of the new CELL's team
    /// @param _owner - Address of the new CELL's owner
    function createSpecialCell(uint _properties, uint8 _initialTeam, address _owner) public onlyRole(ROLE_OPERATOR) returns (uint) {
        require(address(cellContract) != address(0), "cellContract has not been set");

        uint _cellId = cellContract.createCell(_properties, _initialTeam, _owner);

        return _cellId;
    }

    /// @dev Get the properties of a given Cell
    function getCellData(uint _cellId) public view returns (
            int32[2] memory coordinates, 
            address owner, 
            uint8 team, 
            uint8 grade, 
            uint8 stake
        ) {
        require(address(cellContract) != address(0), "cellContract has not been set");

        uint256 _properties;
        (_cellId, coordinates, _properties, team, owner) = cellContract.getCell(_cellId);

        //set a default grade then check if this Cell is special
        grade = cellContract.getCellGrade(_cellId, _properties);
        stake = cellContract.getStake(grade);

        return (coordinates, owner, team, grade, stake);
    }

    /// @dev Figure out the starting sale price for the next discovered Cell
    /// The starting price will be equal to 150% of the average of the last 5 sold
    function _getNextDiscoveredCellPrice() internal view returns (uint) {
        require(address(cellClockAuctionContract) != address(0), "cellClockAuctionContract has not been set");
        
        uint _averagePrice = cellClockAuctionContract.averageDiscoveredCellSalePrice();

        // sanity check to ensure we don't overflow arithmetic (this big number is 2^128-1).
        require(_averagePrice < 340282366920938463463374607431768211455, "Price is insane");

        uint256 _nextPrice = _averagePrice + (_averagePrice / 2);

        // We never auction for less than starting price
        if (_nextPrice < discoveredCellMinPrice) {
            _nextPrice = discoveredCellMinPrice;
        }

        return _nextPrice;
    }
}

